import React from "react";
import "./navigation.css";
import { Link } from "react-router-dom";

export default function Navigation() {
  return (
    <div className="nav">
      <ul>
        <li>
          <Link exact to="/">
            Home
          </Link>
        </li>
        <li>
          <Link to="/presentation">Presentations</Link>
        </li>
        <li>
          <Link to="/addpresentation">Add Presentations</Link>
        </li>
      </ul>
    </div>
  );
}
